  /* e[1+1]=M(e[1+1]) */
  lc_getupvalue(L, lua_upvalueindex(1), 0, 60);
  lua_pushnumber(L, 2);
  lua_gettable(L, 1);
  lua_call(L, 1, 1);
  lua_pushnumber(L, 2);
  lua_insert(L, -2);
  lua_settable(L, 1);
  assert(lua_gettop(L) == 1);

  /* e[2+1]=M(e[2+1]) */
